import React from "react";
import style from "./home.module.css";
export const Home = () => {
  return (
    <div>
      <div className={style.text__container}>
        <span className={style.text}>
          <code>
            {" "}
            <span className={style.span}>&lt;h1&gt; </span>
            Hola, me llamo{" "}
            <span className={style.span}>¡Alexandra Jiménez!,</span> soy
            desarrolladora de software.
            <span className={style.span}> &lt;/h1&gt;</span>
          </code>
        </span>
      </div>
      <p>
        Me gusta mucho javascript,además de estar constantemente aprendiendo
        cosas nuevas.Mis primeros pasos en el desarrollo web fueron de forma autodidacta, me
      gusta formarme también en plataformas como: 
      <ul>
        <li>Freecodecamp</li>
        <li>Google Activate</li>
        <li>Platzi</li>
        <li>Geekshubs</li>
      </ul>


      </p>

    </div>
  );
};
